import React from 'react'

const Online = ({users}) => {
    return (
        <div className="onlineFriendContainer">
            <div className="onlineUsers">
                <div className="onlineSign"></div>
                { users.map((data)=> (
                    <>
                        <img src= { data.userId === 1 && data.user } alt="" className="onlineUserImage" />
                        <p className="onlineUserName">Safeer Ahmed</p>
                    </>
                ))}
            </div>
        </div>
    )
}

export default Online
